import { observable, action, computed, makeObservable } from 'mobx';

class TodoStore {

    constructor() {
        makeObservable(this);
    }

    @observable
    _todo = {
        title: 'test',
    } // id, title, data

    // private get 메서드, 데이터만 만들어 놓고 return
    get todo() {
        return this._todo;
    }
}
export default new TodoStore();
